import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import RollSelection from "./pages/MainPages/RollSelection";
import ManagerLogin from "./pages/LoginPages/ManagerLogin";
import EmployeeLogin from "./pages/LoginPages/EmployeeLogin";
import CustomerLogin from "./pages/LoginPages/CustomerLogin";
import CustomerLog from "./pages/LoginPages/CustomerLog";
import CustomerSignUp from "./pages/LoginPages/CustomerSignUp";

export default function App() {
    return (
        <Router>
            <Switch>
                <Route exact path="/login" component={RolSecim} />
                <Route path="/login/manager" component={ManagerLogin} />
                <Route path="/login/employee" component={EmployeeLogin} />
                <Route path="/login/customer" component={CustomerLog} />
                <Route path="/login/customer/log" component={CustomerLog} />
                <Route path="/login/customer/signup" component={CustomerSignUp} />
                <Route path="/login/customer/login" component={CustomerLogin} />
            </Switch>
        </Router>
    );
}
